import React, {useEffect, useState} from 'react'
import './catFacts.css'

export const CatFacts = () => {
  const [facts, setFacts] = useState([]);

  useEffect(() => {
    update()
    console.log(facts);
  },[])

  const update = async () => {
    try {
      const newFact = await fetch('https://cat-fact.herokuapp.com/facts/random');
      const fact = await newFact.text;
      console.log(fact);
      return fact;
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <div>
      <button id='btn' onClick={() =>
       <ul>{facts.map((entry, i) => {
        <li key={i}>{entry}</li>
      })}
      </ul>}></button>

    </div>
  )
}
